import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

import ReactDOM from "react-dom";
import UserSignup from "./components/UserSignup";
import UserSignin from "./components/UserSignin";
import Header from "./components/Header";
import Home from "./components/Home";
import AdminSignin from "./components/AdminSignin";
import AdminSignup from "./components/AdminSignup";
import Showquiz from "./components/Showquiz";
import Showmarks from "./components/Showmarks";
import Profile from "./components/Profile";
import LoggedHeader from "./components/LoggedHeader";

export default class Index extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      islogged: false
    };
  }

  handleIslogged = value => {
    this.setState({ islogged: value });
  };
  render() {
    return (
      <div className="whole-app">
        <Router>
          {localStorage.quizuserToken ? <Header /> : <LoggedHeader />}
          {/* <Header /> */}

          <Switch>
            <Route path="/" exact component={Home} />
            <Route path="/signup" component={UserSignup} />
            <Route path="/signin">
              <UserSignin handleIslogged={this.handleIslogged} />
            </Route>
            <Route path="/admin" component={AdminSignup} />
            <Route path="/admin/login" component={AdminSignin} />

            <Route path="/quizlist" component={Showquiz} />
            <Route path="/quizsets/:quizname" component={Showquiz} />
          </Switch>
        </Router>
      </div>
    );
  }
}
ReactDOM.render(<Index />, document.getElementById("root"));
